import { Col, Input, Row } from "antd";
import React from "react";
import BpkCalendar from "bpk-component-calendar";
import format from "date-fns/format";

function SearchSub() {
  return (
    <div
      style={{
        background: "black",
        width: "100%",
        margin: "0 auto",
        maxWidth: "1096px",
        height: "220px",
        padding: "1.5em",
      }}
    >
      <Row
        style={{
          width: "20rem",
          margin: "auto",
          width: "100%",
          maxWidth: "900px",
        }}
      >
        <Col xs={{ span: 24 }} md={{ span: 5 }}>
          <Input />
        </Col>
        <Col xs={{ span: 24 }} md={{ span: 5 }}>
          <Input />
        </Col>
        <Col xs={{ span: 24 }} md={{ span: 5 }}>
          <BpkCalendar />
        </Col>
        <Col xs={{ span: 24 }} md={{ span: 5 }}>
          <Input />
        </Col>
        <Col xs={{ span: 24 }} md={{ span: 4 }}>
          <Input />
        </Col>
      </Row>
    </div>
  );
}
export default SearchSub;
